import React from "react";
import { YMaps, Map } from "react-yandex-maps";

class Contacts extends React.Component {
    render() {
        const mapSettings = {
            center: [55.75, 37.57],
            zoom: 9
        }
        return (
            <section>

                <YMaps>
                    <Map defaultState={mapSettings} />
                </YMaps>
            </section>
        )
    }
}

export default Contacts;
